      ...DisplayUnit
    }
  }
`

export const displayFragment = `
  fragment DisplayUnit on DisplayUnit {
    assets {
      url
    }
    cover_image_url: cover_img_url
    body
    disclaimer
    headline
    layout
    link {
      text
      url
    }
    logo
    name
    pixel_tracking_code
  }
`
